import { useEffect, useState } from 'react';
import '../App.css';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
function ReceiptList(){

    const [receipt,setReceipt]=useState()



    useEffect(()=>{
    fetch("http://localhost:8080/receipt",{
        method:"GET"
    })
    .then((res=>res.json()))
    .then((data)=>{

        const {content}=data
        const receiptsWithUsers = content.map(item => {
            const { user, ...receipt } = item;
            return { receipt, user };

          });
        setReceipt(receiptsWithUsers)

    })

    console.log(receiptsWithUsers)
    },[])


    return(
        <>

        <DataTable value={receipt} tableStyle={{ minWidth: '50rem' }}>
                <Column field="code" header="Code"></Column>
                <Column field="name" header="Name"></Column>
                <Column field="category" header="Category"></Column>
                <Column field="quantity" header="Quantity"></Column>
        </DataTable>

        </>)

    }
export default ReceiptList;
